# 
# ## 6. Cross validation
#
# When evaluating different settings (‚Äúhyperparameters‚Äù) for estimators, there is still a risk of overfitting on the
# test set because the parameters can be tweaked until the estimator performs optimally. This way, knowledge about the
# test set can ‚Äúleak‚Äù into the model and evaluation metrics no longer report on generalization performance.
#
# A solution to this problem is a procedure called cross-validation. In the basic approach, called k-fold CV, the
# training set is split into k smaller sets (other approaches are described below, but generally follow the same
# principles). The following procedure is followed for each of the k ‚Äúfolds‚Äù:
#
# - A model is trained using k - 1 of the folds as training data
#
# - The resulting model is validated on the remaining part of the data (i.e., it is used as a test set to compute a
# performance measure such as accuracy)
#
# The performance measure reported by k-fold cross-validation is then the average of the values computed in the loop.

