pipe = pipeline.make_pipeline(
    tree.DecisionTreeClassifier(),  # LINE TO BE REMOVED FOR STUDENTS
)

max_depths = [3, 5, 10, 20]  # LINE TO BE REMOVED FOR STUDENTS
class_weights = [None, "balanced"]  # LINE TO BE REMOVED FOR STUDENTS

